INSERT INTO `Article` VALUES ('2c93d8e452ca3e130152ca57712a0001', '2016-01-18 16:41:14', '2016-02-13 20:48:01', '九翊软件', '<p style=\"font-family: Arial, 宋体; font-size: 12px; line-height: 23px; text-align: justify;\"><strong>尊敬的客户朋友们:</strong></p>\r\n<p style=\"font-family: Arial, 宋体; font-size: 12px; line-height: 23px; text-align: justify;\">九翊定于2月7日-14日放假，2月15号正式上班。&nbsp;</p>\r\n<p style=\"font-family: Arial, 宋体; font-size: 12px; line-height: 23px; text-align: justify;\">放假期间如需技术支持，请拨打紧急联系电话：13958044706。&nbsp;</p>\r\n<p style=\"font-family: Arial, 宋体; font-size: 12px; line-height: 23px; text-align: justify;\">顺祝新年愉快！阖家幸福！</p>', '0', '/html/article_content/201602/0e39e5ccfd5148d1bb1124df629e2be0.html', b'1', b'1', b'1', '<p>尊敬的客户朋友们:</p>\r\n<p>九翊定于2月7日-14日放假，2月15号正式上班。 \r\n放假期间如需技术支持，请拨打紧急联系电话：13958044706。 </p>\r\n<p>顺祝新年愉快！阖家幸福！</p>', '放假通知', '1', '【放假通知】2016春节', '2c93d8e452da24050152da6063440004', '[{\"bigArticleImagePath\":\"/upload/image/201602/9fe9a29460c0456482afd81f4c153b62_big.jpg\",\"id\":\"9fe9a29460c0456482afd81f4c153b62\",\"smallArticleImagePath\":\"/upload/image/201602/9fe9a29460c0456482afd81f4c153b62_small.jpg\",\"sourceArticleImagePath\":\"/upload/image/201602/9fe9a29460c0456482afd81f4c153b62.jpeg\",\"thumbnailArticleImagePath\":\"/upload/image/201602/9fe9a29460c0456482afd81f4c153b62_thumbnail.jpg\"}]'), ('2c93d8e452d5a05d0152d5aeb54c0001', '2016-01-25 21:32:23', '2016-02-14 10:22:07', '九翊软件', '<p>九翊2015-2016年会</p>\r\n<p>&nbsp;</p>', '0', '/html/article_content/201602/686129a24a244c88ab591fd506ca47da.html', b'1', b'1', b'0', '<p>\r\n九翊年会于2016年1月22日-1月23日在江苏苏州召开。年会到场73人，年会从上午12点正式开始。</p>\r\n<p>\r\n公司领导首先进行了讲话，总结了2015年的情况，对于2016年给予了较高的重视。其后，由公司咨询部负责人王总对公司企业文化和员工进行了一次深入沟通。之后公司评出了优秀员工、最佳新人和创新奖。\r\n</p>', '年会', '1', '【公司动态】九翊2015-2016年会', '2c93d8e452da24050152da6063440004', '[{\"bigArticleImagePath\":\"/upload/image/201602/db682640b946458f9e30fd3ebd21972d_big.jpg\",\"id\":\"db682640b946458f9e30fd3ebd21972d\",\"smallArticleImagePath\":\"/upload/image/201602/db682640b946458f9e30fd3ebd21972d_small.jpg\",\"sourceArticleImagePath\":\"/upload/image/201602/db682640b946458f9e30fd3ebd21972d.png\",\"thumbnailArticleImagePath\":\"/upload/image/201602/db682640b946458f9e30fd3ebd21972d_thumbnail.jpg\"}]'), ('2c93d8e452d8704c0152d8739d130001', '2016-02-13 10:26:42', '2016-02-14 11:23:07', '九翊软件', '<p style=\"margin: 0px; padding: 6px 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; font-family: \'Microsoft YaHei\', Arial, sans-serif; color: #333333; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">许多企业都寻求通过货源开发和采购职能节约成本，以提高财务成绩。有远见的公司非常关注作为利润中心的采购运作过程，而努力巩固供应商关系，并使采购部门成为组织机构更具战略意义的合作伙伴。</p>\r\n<p style=\"margin: 0px; padding: 6px 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; font-family: \'Microsoft YaHei\', Arial, sans-serif; color: #333333; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; background: transparent;\">TSRM供应商关系管理系统</strong>能够通过持续节约成本、确保合同合规性和缩短实现价值的时间，为您提供战略价值，并支持端到端流程，可为您公司带来卓越成果。该解决方案还可全面支持开销分析、货源开发、运营合同、请购、发票开具和供应商管理等活动。</p>\r\n<p style=\"margin: 0px; padding: 6px 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; font-family: \'Microsoft YaHei\', Arial, sans-serif; color: #333333; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">面临着对持续获利能力的业务需求，各种规模的企业纷纷寻求采购和购置来源，以及管理供应商支出的底线优势。如果能够降低采购产品和服务的成本，就可以提高获利能力，而不会增加销售支出或者影响质量。</p>\r\n<p style=\"margin: 0px; padding: 6px 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; font-family: \'Microsoft YaHei\', Arial, sans-serif; color: #333333; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">这正是TSRM供应商关系管理(TSRM)解决方案能够做到的，并从以下三个方面给与关键支持：</p>\r\n<p style=\"margin: 0px; padding: 6px 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; font-family: \'Microsoft YaHei\', Arial, sans-serif; color: #333333; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; background: transparent;\">企业支出分析</strong></p>\r\n<ul class=\"greyDotList_col1 lineheight22_list\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; list-style: none outside; font-family: \'Microsoft YaHei\', Arial, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">\r\n<li style=\"margin: 0px; padding: 0px 0px 0px 20px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; list-style: none outside; line-height: 22px; color: #333333; background: url(\'../NX_images/incoming_icon.jpg\') 5px 7px no-repeat;\">采用统一的标准化支出数据来管理费用支出，确保支出数据的一致性。</li>\r\n<li style=\"margin: 0px; padding: 0px 0px 0px 20px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; list-style: none outside; line-height: 22px; color: #333333; background: url(\'../NX_images/incoming_icon.jpg\') 5px 7px no-repeat;\">分析并确定节省机会（例如，非契约购买 ，相同商品的价差和低水准供应商），实现费用支出的完全透明化。</li>\r\n</ul>\r\n<p style=\"margin: 0px; padding: 6px 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; font-family: \'Microsoft YaHei\', Arial, sans-serif; color: #333333; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; background: transparent;\">战略性采购</strong></p>\r\n<ul class=\"greyDotList_col1 lineheight22_list\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; list-style: none outside; font-family: \'Microsoft YaHei\', Arial, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">\r\n<li style=\"margin: 0px; padding: 0px 0px 0px 20px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; list-style: none outside; line-height: 22px; color: #333333; background: url(\'../NX_images/incoming_icon.jpg\') 5px 7px no-repeat;\">定义和应用采购最佳实践；跟踪关键任何和里程碑事件；捕获项目库中的支持文件；利用一个公用的系统与主要利益相关方进行协作。确保符合采购流程，能够满足管理目标下的节省和支出要求。</li>\r\n<li style=\"margin: 0px; padding: 0px 0px 0px 20px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; list-style: none outside; line-height: 22px; color: #333333; background: url(\'../NX_images/incoming_icon.jpg\') 5px 7px no-repeat;\">增强供货商挖掘能力，开发合格的供货商群，实现协商节省成本，确保能够与更多战略供货商进行战略接触。</li>\r\n<li style=\"margin: 0px; padding: 0px 0px 0px 20px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; list-style: none outside; line-height: 22px; color: #333333; background: url(\'../NX_images/incoming_icon.jpg\') 5px 7px no-repeat;\">精简端到端采购活动，实现高效内外部协作，从而能够在较短的周期时间内快速利用协商节省成本。</li>\r\n</ul>\r\n<p style=\"margin: 0px; padding: 6px 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; font-family: \'Microsoft YaHei\', Arial, sans-serif; color: #333333; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; background: transparent;\">合同管理</strong></p>\r\n<ul class=\"greyDotList_col1 lineheight22_list\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; list-style: none outside; font-family: \'Microsoft YaHei\', Arial, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">\r\n<li style=\"margin: 0px; padding: 0px 0px 0px 20px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; list-style: none outside; line-height: 22px; color: #333333; background: url(\'../NX_images/incoming_icon.jpg\') 5px 7px no-repeat;\">将商定条款无缝地转移到经营性采购中去，以节省成本。</li>\r\n<li style=\"margin: 0px; padding: 0px 0px 0px 20px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; list-style: none outside; line-height: 22px; color: #333333; background: url(\'../NX_images/incoming_icon.jpg\') 5px 7px no-repeat;\">统一和标准化合同管理流程，确保协商条款始终用于经营性采购。</li>\r\n<li style=\"margin: 0px; padding: 0px 0px 0px 20px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; list-style: none outside; line-height: 22px; color: #333333; background: url(\'../NX_images/incoming_icon.jpg\') 5px 7px no-repeat;\">统一和自动化合同谈判、订立和实施流程。加快的周期时间减少了单独采购，加快了合同利用步伐。</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 6px 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; font-family: \'Microsoft YaHei\', Arial, sans-serif; color: #333333; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">TSRM供应商关系管理实现了企业内以及供应商之间采购和购置流程的自动化，提高了对供应链的洞察力，并且使客户能够全面地了解全球的费用支出情况。帮助企业创造最佳节省机会，实现采购的战略转型。</p>', '0', '/html/article_content/201602/99c92c54f661472fa87ec3e407124ee9.html', b'1', b'1', b'1', '<p>许多企业都寻求通过货源开发和采购职能节约成本，以提高财务成绩。有远见的公司非常关注作为利润中心的采购运作过程，而努力巩固供应商关系，并使采购部门成为组织机构更具战略意义的合作伙伴。</p>\r\n<p>TSRM供应商关系管理系统能够通过持续节约成本、确保合同合规性和缩短实现价值的时间，为您提供战略价值，并支持端到端流程，可为您公司带来卓越成果。该解决方案还可全面支持开销分析、货源开发、运营合同、请购、发票开具和供应商管理等活动。</p>\r\n<p>面临着对持续获利能力的业务需求，各种规模的企业纷纷寻求采购和购置来源，以及管理供应商支出的底线优势。如果能够降低采购产品和服务的成本，就可以提高获利能力，而不会增加销售支出或者影响质量。</p>', '供应链管理 供应商协同', '5', 'TSRM供应商管理系统', '2c93d8e452c923dc0152c92e88150002', '[{\"bigArticleImagePath\":\"/upload/image/201602/508daaf3da2046e5af37ba125653179d_big.jpg\",\"id\":\"508daaf3da2046e5af37ba125653179d\",\"smallArticleImagePath\":\"/upload/image/201602/508daaf3da2046e5af37ba125653179d_small.jpg\",\"sourceArticleImagePath\":\"/upload/image/201602/508daaf3da2046e5af37ba125653179d.png\",\"thumbnailArticleImagePath\":\"/upload/image/201602/508daaf3da2046e5af37ba125653179d_thumbnail.jpg\"}]'), ('2c93d8e452d8ae5d0152d8bbeb9d0001', '2016-02-13 11:45:40', '2016-02-13 11:48:21', '九翊软件', '<p>热烈庆祝建新TMS系统正式上线！</p>', '0', '/html/article_content/201602/ab7db370e9494ff3b4c51a0c7c188a99.html', b'1', b'1', b'0', '', 'TMS系统', '1', '建新赵氏TMS系统', '2c93d8e452ca724c0152ca7833350001', '[{\"bigArticleImagePath\":\"/upload/image/201602/28b5253f086446a8a76910170fb098f7_big.jpg\",\"id\":\"28b5253f086446a8a76910170fb098f7\",\"smallArticleImagePath\":\"/upload/image/201602/28b5253f086446a8a76910170fb098f7_small.jpg\",\"sourceArticleImagePath\":\"/upload/image/201602/28b5253f086446a8a76910170fb098f7.jpeg\",\"thumbnailArticleImagePath\":\"/upload/image/201602/28b5253f086446a8a76910170fb098f7_thumbnail.jpg\"}]'), ('2c93d8e452d8ae5d0152d8c29dc00002', '2016-02-13 11:52:59', '2016-02-13 11:52:59', '九翊软件', '<p>热烈庆祝萌蒂制药OA-SAP集成项目上线！</p>', '0', '/html/article_content/201602/34659964feb24efbb248ba56f719ead7.html', b'1', b'1', b'0', '', '萌蒂制药 OA-SAP', '1', '萌蒂制药OA-SAP集成', '2c93d8e452ca724c0152ca7833350001', '[{\"bigArticleImagePath\":\"/upload/image/201602/bec99c8e1840488fac8eadc9c5f163c1_big.jpg\",\"id\":\"bec99c8e1840488fac8eadc9c5f163c1\",\"smallArticleImagePath\":\"/upload/image/201602/bec99c8e1840488fac8eadc9c5f163c1_small.jpg\",\"sourceArticleImagePath\":\"/upload/image/201602/bec99c8e1840488fac8eadc9c5f163c1.png\",\"thumbnailArticleImagePath\":\"/upload/image/201602/bec99c8e1840488fac8eadc9c5f163c1_thumbnail.jpg\"}]'), ('2c93d8e452ddc4a70152ddca9c790001', '2016-02-14 11:19:49', '2016-02-14 11:26:35', '九翊软件', '<div>传统的SAP ERP和OA软件实施，仅将业务流程的关键数据输入到SAP ERP中进行业务流转控制，但其完整的流程还处在SAP ERP系统管控之外。OA软件提供了强大的企业运营流程管理的系统支持，但流程传递的数据和SAP ERP并没有形成无缝的链接。</div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp;TOASAP不是简单的进行了SAP-OA 间的接口技术处理，而是针对多达120个ERP相关的企业核心经营流程进行梳理和OA功能规划, 将流程集成到OA中实现，并与SAP无缝连接。<br />&nbsp;</div>\r\n<div>OA集成功能简要介绍&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 关键主数据<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;物料主数据管理<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; BOM主数据管理<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 工艺主数据管理<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 工程变更管理流程</div>\r\n<div>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 销售相关<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 客户主数据管理流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 销售价格审批流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 信贷额度审批流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 销售订单审批流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 信贷额度超限审批流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 免费样品申请流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 销售催款流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 客户服务门户<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 经销商服务门户</div>\r\n<div>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 采购相关<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 供应商主数据管理流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 采购价格审批流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 办公用品采购流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 固定资产采购流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 服务采购流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 采购订单审批流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 采购付款审批流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 采购预付款审批流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 供应商服务门户<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 仓库管理相关<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 成本中心领退料流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 报废申请流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 呆滞物资管理流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 研发领退料流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 财务管理相关<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 预算管理流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 费用申请/核销流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 员工借款/还款流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 研发项目内部订单创建流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 各类报表<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 按需定制SAP报表在OA的展现<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 按需定制监控报表主动预警功能(SAP业务数据超过设定标准，OA系统主动推送信息)</div>', '0', '/html/article_content/201602/5c531067cb0745f8a421a560889e108c.html', b'1', b'1', b'0', '<p>TOASAP不是简单的进行了SAP-OA 间的接口技术处理，而是针对多达120个ERP相关的企业核心经营流程进行梳理和OA功能规划, 将流程集成到OA中实现，并与SAP无缝连接。</p>\r\n<p>传统的SAP ERP和OA软件实施，仅将业务流程的关键数据输入到SAP ERP中进行业务流转控制，但其完整的流程还处在SAP ERP系统管控之外。OA软件提供了强大的企业运营流程管理的系统支持，但流程传递的数据和SAP ERP并没有形成无缝的链接。\r\n</p>', 'OA-SAP集成', '2', '九翊TOASAP集成解决方案', '2c93d8e452c923dc0152c92e88150002', null);
COMMIT;

