INSERT INTO `brand` VALUES ('2c93d8e452d93cea0152d94bf7c30002', '2016-02-13 14:23:01', '2016-02-13 14:23:01', '<div class=\"centerspecialto\">\r\n<div class=\"centerspecialtocontent\">泛微成立于2001年，总部设立于上海，专注于协同管理软件领域，并致力于以协同OA为核心帮助企业构建全员统一的移动办公平台。在移动办公领域，打造了上海医药、复星集团、绿地集团等多个业界标杆。泛微是&ldquo;国家规划布局内重点软件企业&rdquo;，2013年泛微入选福布斯中国潜力非上市公司100强，并以近3年高增长优势位居第10名席位。十多年来，泛微以专注、专业的态度，以强大的产品研发能力、本地化能力、咨询能力，成功服务于全国上万家企事业单位客户，其中包括PICC、绿地集团、中国能建、上汽集团、浙江物产集团、正威集团、复星集团、百丽国际、上海医药、格力电器、TCL、双汇集团、伊利集团、恒安集团、万达集团、王府井百货等世界及中国500强企业。\r\n<p>&nbsp;</p>\r\n<p>专注协同管理软件领域15年，泛微拥有自主知识产权的协同管理软件系列产品。在企业级移动互联大潮下，泛微发布了以&ldquo;移动化、社交化、平台化、云端化&rdquo;四化为核心的全新一代产品系列，包括面向大中型企业的平台型产品e-cology、面向中小型企业的应用型产品e-office、面向小微型企业的云办公产品eteams，以及帮助企业对接移动互联的移动办公平台e-mobile、移动集成平台等。</p>\r\n<p>目前，泛微产品技术研发已陆续实现组织内外部的协同商务、智能数据组织行为分析、云计算的互联网办公中心、社交化协同应用、实现个人企业协同互联、语音智能办公,我们始终持续创新让更多的组织从泛微的协同软件中受益！泛微致力于为广大协同软件行业的伙伴建设一个共享的技术平台、一个共享的服务网络，联合做大做强协同软件市场。未来，泛微公司将继续与所有的业界同仁共同开拓和推广中国的信息化应用，为提升企业的管理水平和竞争力做出自己的贡献！此外，泛微用重金打造的泛微协同软件产业园一定能够整合协同软件的上下游产业，为客户提供更好的服务。</p>\r\n</div>\r\n</div>\r\n<div class=\"centerspecialtospace\">&nbsp;</div>\r\n<div class=\"centerspecialto\">\r\n<div class=\"centerspecialtotitle\">\r\n<table border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"style02\" scope=\"col\" align=\"left\" valign=\"top\"><strong>数字泛微</strong></td>\r\n<td class=\"style03\" scope=\"col\" align=\"right\" valign=\"top\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div class=\"centerspecialtocontent\">\r\n<p><strong>1个目标：</strong><br />十年如一日，泛微从2001年成立至今始终专注于一个目标：为客户提供适用的协同管理软件产品；<br /><br /><strong>15年：</strong><br />15年专注协同软件的研发与服务，泛微目前拥有成熟的内部运营管理和客户服务体系，让每一位泛微的用户感受到泛微的专业服务；<br /><br /><strong>30多个行业85个细分领域：</strong><br />依托在行业信息化领域的多年探索、实践以及丰富的实践案例，泛微提供35个行业85个细分领域解决方案，全国200多名行业方案专家为客户量身定制个性化落地方案；<br /><br /><strong>100多家服务网点：</strong><br />100多家服务网点、300多名高级顾问，专业力量遍布全国各省市，本地化服务体系实现对客户服务的高效响应；<br /><br /><strong>1600多位同仁：</strong><br />全国1600多名泛微专业人士为客户提供全方位的优质的协同管理软件产品、方案和服务；<br /><br /><strong>20000多家用户,其中6000多家大中型组织用户：</strong><br />泛微在全国拥有20000多家用户，其中6000多家大中型组织用户，覆盖85个细分领域，拥有广泛的客户实践积淀；<br /><br /><strong>50,000,000注册资金：</strong><br />5000万注册资金，充足的资金储备、持续增长的公司业绩是实力的见证、也是持续快速发展的保障。</p>\r\n</div>\r\n</div>\r\n<div class=\"centerspecialtospace\">&nbsp;</div>\r\n<div class=\"centerspecialto\">\r\n<div class=\"centerspecialtotitle\">\r\n<table border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"style02\" scope=\"col\" align=\"left\" valign=\"top\"><strong>我们的优势</strong></td>\r\n<td class=\"style03\" scope=\"col\" align=\"right\" valign=\"top\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div class=\"centerspecialtocontent\">\r\n<p><strong>我们的品牌：</strong><br />2001年开始持续专注在协同管理软件领域；<br />上万家基础客户、数百家行业灯塔用户；<br />泛微（weaver）品牌受到用户认可。<br /><br /><strong>我们的产品：</strong><br />成熟的协同管理产品体系；<br />基于移动互联的管理思想和设计理念；<br />全面和深化的协同应用为客户带来价值；<br />高度的灵活性和扩展性；<br />系列产品和解决方案满足企业的不同应用需求。<br /><br /><strong>我们的研发：</strong><br />规模化的研发中心；<br />持续的研发投入；<br />与时俱进的开发技术；<br />封闭式研发；<br />ISO9001质量认证；<br />国际CMM3认证。<br /><br /><strong>我们的服务：</strong><br />对协同应用和办公领域的深度认知，多个行业的实践经验，有丰富的经验为用户提供服务；<br />提供可行的IT整体规划和分步实施方案，对客户内部管理有效改进建议；使产品的应用获得客户预期价值； <br />完整的服务体系，涵盖咨询、方案、实施、培训、技术支持、版本升级等；<br />多种服务方式，包括网站、邮件、电话、电子期刊、自助问答、企业知识库等；<br />遍布全国的服务网络，专业的咨询和服务人员。<br /><br /><strong>我们的资质：</strong><br />福布斯中国非上市潜力公司100强前十 <br />国家规划布局内重点软件企业 <br />中国协同管理软件领军品牌 <br />通用云应用开发商 上海市著名商标 <br />上海市明星软件企业 <br />上海交通大学安泰经济与管理学院实习基地 <br />2013年度上海市优秀软件产品 ( 标准版软件 V8.0)&nbsp;&nbsp;&nbsp; <br />2013年度上海市优秀软件产品 ( 协同商务软件 V7.0)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br />2011-2012年度国家规划布局内重点软件企业 <br />2012年度中国协同办公领域客户满意最佳品牌</p>\r\n</div>\r\n</div>', '/upload/image/201602/9164952afdf846ba897d61e6c92d6864.jpg', '泛微软件', '50', 'http://www.weaver.com.cn'), ('2c93d8e452d93cea0152d94ca8ac0003', '2016-02-13 14:23:46', '2016-02-13 14:23:46', '<p>上海九翊软件科技有限公司是由上海九慧信息科技有限公司和上海泛微网络股份有限公司投资成立的企业供应链协同软件服务商。 <br /><br />九翊软件基于互联网技术架构，围绕高端OA和SAP ERP业务领域，推出了满足企业应用协同的一系列软件。包括</p>\r\n<ul>\r\n<li>经销商电子商务平台</li>\r\n<li>供应商协同采购管理平台</li>\r\n<li>智能工厂管理平台</li>\r\n<li>企业运输管理云平台</li>\r\n<li>物流仓储条码管理系统</li>\r\n<li>其他供应链管理系统</li>\r\n</ul>\r\n<p>九翊软件从成立之初开始，便依托泛微OA实施了多个基于SAP-OA系统的业务办公一体化项目，典型案例包括：上汽进出口、海亮集团、海天集团、建新集团、得力文具、香雪制药、虹信通信、中央商场、湖南卫视快乐购、三棵树漆、双林汽车、物产集团等。</p>\r\n<h4>投资者关系</h4>\r\n<p>&nbsp;</p>\r\n<blockquote>九翊的投资方泛微软件成立于2001年，总部设立于上海，专注于协同管理软件领域，并致力于以协同OA为核心帮助企业构建全员统一的移动办公平台。在移动办公领域，打造了上海医药、复星集团、绿地集团等多个业界标杆。泛微是&ldquo;国家规划布局内重点软件企业&rdquo;，2013年泛微入选福布斯中国潜力非上市公司100强，并以近3年高增长优势位居第10名席位。十多年来，泛微以专注、专业的态度，以强大的产品研发能力、本地化能力、咨询能力，成功服务于全国上万家企事业单位客户，其中包括PICC、绿地集团、中国能建、上汽集团、浙江物产集团、正威集团、复星集团、百丽国际、上海医药、格力电器、TCL、双汇集团、伊利集团、恒安集团、万达集团、王府井百货等世界及中国500强企业。 <br />九翊的另一个投资方上海九慧是一家专业提供信息化咨询及服务的高科技企业，通过高端SAP ERP实施、运维服务、系统优化、培训，帮助企业在网络化时代改进管理、优化业务流程、提高市场竞争力，并促进企业间实施协同商务运作的能力；是全球领先的ERP软件厂商德国SAP公司的合作伙伴。</blockquote>\r\n<p>&nbsp;</p>\r\n<p>关于九慧信息可访问 http://www.think-way.net 或关注微信公众号 \"九慧信息\" 获取。</p>\r\n<p>关于泛微软件可访问 http://www.weaver.com.cn 或关注微信公众号 \"泛微软件\" 获取。</p>', '/upload/image/201602/e55894a5b49e4a628bdfd99afdb27830.png', '九翊软件', '50', 'http://www.jiuyisoft.com');
COMMIT;

