INSERT INTO `product` VALUES ('2c93d8e452d93cea0152d948cc2d0001', '2016-02-13 14:19:33', '2016-02-14 10:22:57', '<div>传统的SAP ERP和OA软件实施，仅将业务流程的关键数据输入到SAP ERP中进行业务流转控制，但其完整的流程还处在SAP ERP系统管控之外。OA软件提供了强大的企业运营流程管理的系统支持，但流程传递的数据和SAP ERP并没有形成无缝的链接。</div>\r\n<div>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 泛微九慧SAP联合解决方案中心不是简单的进行了SAP-OA 间的接口技术处理，而是针对多达120个ERP相关的企业核心经营流程进行梳理和OA功能规划, 将流程集成到OA中实现，并与SAP无缝连接。<br />&nbsp;</div>\r\n<div>OA集成功能简要介绍&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 关键主数据<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;物料主数据管理<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; BOM主数据管理<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 工艺主数据管理<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 工程变更管理流程</div>\r\n<div>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 销售相关<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 客户主数据管理流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 销售价格审批流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 信贷额度审批流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 销售订单审批流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 信贷额度超限审批流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 免费样品申请流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 销售催款流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 客户服务门户<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 经销商服务门户</div>\r\n<div>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 采购相关<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 供应商主数据管理流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 采购价格审批流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 办公用品采购流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 固定资产采购流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 服务采购流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 采购订单审批流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 采购付款审批流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 采购预付款审批流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 供应商服务门户<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 仓库管理相关<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 成本中心领退料流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 报废申请流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 呆滞物资管理流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 研发领退料流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 财务管理相关<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 预算管理流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 费用申请/核销流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 员工借款/还款流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 研发项目内部订单创建流程<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 各类报表<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 按需定制SAP报表在OA的展现<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 按需定制监控报表主动预警功能(SAP业务数据超过设定标准，OA系统主动推送信息)</div>', '0', '/html/product_content/201602/c1cdea15ab6d4ab3b4ece8f204fca24e.html', b'1', b'1', b'1', b'1', '100000.00000', '<p><strong style=\"color:#d98f19\">九翊OA-SAP集成产品</strong>不是简单的进行了SAP-OA 间的接口技术处理，而是针对多达120个ERP相关的企业核心经营流程进行梳理和OA功能规划, 将流程集成到OA中实现，并与SAP无缝连接。</p>', '泛微 OA-SAP集成', 'TOASAP最新集成套件', '0', '98888.00000', '[{\"bigProductImagePath\":\"/upload/image/201602/ce716999e5d34c3991836d65ab38f338_big.jpg\",\"id\":\"ce716999e5d34c3991836d65ab38f338\",\"smallProductImagePath\":\"/upload/image/201602/ce716999e5d34c3991836d65ab38f338_small.jpg\",\"sourceProductImagePath\":\"/upload/image/201602/ce716999e5d34c3991836d65ab38f338.png\",\"thumbnailProductImagePath\":\"/upload/image/201602/ce716999e5d34c3991836d65ab38f338_thumbnail.jpg\"},{\"bigProductImagePath\":\"/upload/image/201602/087b721e80e743508e2a8a64b458c9ee_big.jpg\",\"id\":\"087b721e80e743508e2a8a64b458c9ee\",\"smallProductImagePath\":\"/upload/image/201602/087b721e80e743508e2a8a64b458c9ee_small.jpg\",\"sourceProductImagePath\":\"/upload/image/201602/087b721e80e743508e2a8a64b458c9ee.png\",\"thumbnailProductImagePath\":\"/upload/image/201602/087b721e80e743508e2a8a64b458c9ee_thumbnail.jpg\"}]', '10001', null, '1000', '0', '2c93d8e452d93cea0152d94ca8ac0003', '2c93d8e952a229150152a22e0ec80002', '2c93d8e452d93cea0152d96525240004'), ('2c93d8e452d9fa370152d9fdd1ff0002', '2016-02-13 17:37:16', '2016-02-13 18:05:08', '<p><strong>汽配行业背景<br /></strong>&nbsp; 我国作为全球第二大汽车生产国和第二大汽车消费国，2008年我国生产汽车934.5万辆。巨大的汽车产能和消费市场为汽配行业发展开辟了广阔的市场空间。<br /><br /><strong>汽配行业现状</strong><br />&nbsp; 汽配企业是围绕主机厂为核心形成密集的产业链。从横向上来看，汽配企业的同行业竞争激烈，在零配件的价格、质量、供货、服务等方面都面临多家对比。随着全球一体化进程的深入，汽配企业不仅面对越来越多国际竞争对手的压力，也面临广阔国际市场的挑战，如何提高自身的竞争力，和汽车主机厂建立长期稳定的供货关系是汽配企业努力的方向。纵向上分析，在汽车产业链中的某个汽配厂商，受到来自主机厂和下游供应商的多重压力：一方面，主机厂为了压缩库存、降低成本而尽可能地把成本和风险传递给配套厂商；另一方面，下游供应商供货质量情况又影响了配套厂的生产，进而影响向主机厂的供货。<br /><br /><strong>集团化经营</strong><br />&nbsp;&nbsp;中国汽配企业，特别是民营企业，数量多，经营规模小，产业集中度很低。汽配企业的经营规模迅速扩大，涌现了一些集团化经营的汽配企业。随着行业竞争日趋激烈，企业间的兼并、重组的力度和步伐会进一步加大。<br /><br /><strong>面临多方压力，汽配行业平均利润率下降</strong><br />&nbsp; 受汽车品牌销售政策的影响，主要新车型均走4S模式，使得汽车配件的独立售后市场受到一定影响；人们消费观念发生变化，由重维修转向重保养，使得配件消耗量有所减少；由于汽车行业整体形势较好，汽配流通门槛较低，因而进入者众多；由于工厂追求渠道扁平化，更重视终端销售，使得汽配中间商机会减少。这些因素，导致汽配流通行业平均利润率下降。<br /><br /><strong>汽配企业必须跨越的\"三座大山\"</strong><br />&nbsp; 在新一轮竞争和发展中，上游的压价、下游的涨价，跨国公司同台竞争的严峻挑战，是摆在国内汽车零部件企业面前现实而又不得不破解的三大难题，是汽配企业必须跨越的\"三座大山\"。<br />所以为了应对外部多方压力，汽配企业必须抓好内部多方面的管理控制：在销售方面追求准时、按质、按量交货；在生产方面，保持与主机厂生产节拍一致，灵活应变；在采购方面控制下游供应商按时、按质、按量供货；在库存方面，满足生产需求下尽可能降低库存；在质量方面，全面质量管理，业务控制；在财务方面，日常大量业务的处理，精细的零部件、产品成本核算以及成本控制等。<br /><br /><strong>汽车行业术语</strong></p>\r\n<table class=\"ke-zeroborder\" border=\"0\" cellspacing=\"1\" cellpadding=\"0\" bgcolor=\"#000000\">\r\n<tbody>\r\n<tr>\r\n<td bgcolor=\"#ffffff\"><strong>标准名称</strong></td>\r\n<td bgcolor=\"#ffffff\"><strong>名称解释</strong></td>\r\n</tr>\r\n<tr>\r\n<td bgcolor=\"#ffffff\">零件</td>\r\n<td bgcolor=\"#ffffff\">不采用装配工序制成的单一成品、单个制件通常不能再分解的制件</td>\r\n</tr>\r\n<tr>\r\n<td bgcolor=\"#ffffff\">子总成</td>\r\n<td bgcolor=\"#ffffff\">由两个或多个零件经装配工序或组合加工对分总成有隶属装配级别关系</td>\r\n</tr>\r\n<tr>\r\n<td bgcolor=\"#ffffff\">分总成</td>\r\n<td bgcolor=\"#ffffff\">由两个或多从零件与子总成一起采用装配工序组合对总成的隶属装配级别关系</td>\r\n</tr>\r\n<tr>\r\n<td bgcolor=\"#ffffff\">总成</td>\r\n<td bgcolor=\"#ffffff\">由数个零件、数个分总成或它们之间的任意组合具备一定装配级别或某一功能形式的组合体具体装配分解特性</td>\r\n</tr>\r\n<tr>\r\n<td bgcolor=\"#ffffff\">零部件</td>\r\n<td bgcolor=\"#ffffff\">包括总成、分总成、子总成、零件</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><br /><strong>汽车配件供应体系：</strong><br />采购策略一：纵向一体化、平行式供应体系（欧美系）<br /><img src=\"http://www.chixm.com/Upload/Image/Solution/oumei.gif\" alt=\"\" /><br />关系模式：无资本联系，关系平等以市场竞争为基础，是相互独立的合同和契约关系。<br />开发模式：自主开发，汽车制造企业无权干涉，关键零部件供应商专业技术很可能超过汽车制造企业。<br />价格原则：对所有供应商一视同仁采用市场价格原则定价。<br /><br />采购策略二：塔式供应体系（日系）<br /><img src=\"http://www.chixm.com/Upload/Image/Solution/rixi.gif\" alt=\"\" /><br />关系模式：控制一级及关键供应商股份，是隶属关系。<br />开发模式：严格控制所有开发项目且开发项目是建立在整车企业零部件需求的基础上，无自主权。<br />价格原则：由汽车制造企业定价。<br /><br />采购策略三：中国特色的混合模式</p>\r\n<table class=\"ke-zeroborder\" border=\"0\" cellspacing=\"1\" cellpadding=\"0\" bgcolor=\"#000000\">\r\n<tbody>\r\n<tr>\r\n<td bgcolor=\"#ffffff\"><strong>企业性质</strong></td>\r\n<td bgcolor=\"#ffffff\"><strong>采购模式</strong></td>\r\n<td bgcolor=\"#ffffff\"><strong>代表企业</strong></td>\r\n</tr>\r\n<tr>\r\n<td bgcolor=\"#ffffff\">中美、欧合资</td>\r\n<td bgcolor=\"#ffffff\">纵向一体化、平行式</td>\r\n<td bgcolor=\"#ffffff\">上汽、一汽</td>\r\n</tr>\r\n<tr>\r\n<td bgcolor=\"#ffffff\">中日合作</td>\r\n<td bgcolor=\"#ffffff\">塔式</td>\r\n<td bgcolor=\"#ffffff\">东风</td>\r\n</tr>\r\n<tr>\r\n<td rowspan=\"2\" bgcolor=\"#ffffff\">自主品牌</td>\r\n<td bgcolor=\"#ffffff\">使用老的供应商</td>\r\n<td bgcolor=\"#ffffff\">吉利原有摩托车配件供应商</td>\r\n</tr>\r\n<tr>\r\n<td bgcolor=\"#ffffff\">与合资企业共用供应商、采用全国采购供应方式</td>\r\n<td bgcolor=\"#ffffff\">奇瑞</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>', '0', '/html/product_content/201602/d527bc43a1d4445d8f68beb1dbaa20bb.html', b'0', b'0', b'1', b'0', '100000.00000', '<p><strong style=\"color:#d98f19\">汽配行业集成包</strong>汽配企业是围绕主机厂为核心形成密集的产业链。从横向上来看，汽配企业的同行业竞争激烈，在零配件的价格、质量、供货、服务等方面都面临多家对比。</p>', '泛微 OA-SAP集成', '汽配行业集成包', '0', '98888.00000', '[{\"bigProductImagePath\":\"/upload/image/201602/45c9570d0c284bfc9b46d5afffd2c635_big.jpg\",\"id\":\"45c9570d0c284bfc9b46d5afffd2c635\",\"smallProductImagePath\":\"/upload/image/201602/45c9570d0c284bfc9b46d5afffd2c635_small.jpg\",\"sourceProductImagePath\":\"/upload/image/201602/45c9570d0c284bfc9b46d5afffd2c635.png\",\"thumbnailProductImagePath\":\"/upload/image/201602/45c9570d0c284bfc9b46d5afffd2c635_thumbnail.jpg\"}]', '10000', null, '1000', '0', '2c93d8e452d93cea0152d94ca8ac0003', '2c93d8e952a229150152a22e0ec80002', '2c93d8e452d93cea0152d96525240004');
COMMIT;

